import { RiEdit2Fill, RiUpload2Line } from "react-icons/ri";
import { useSelector } from "react-redux";
import './app.css'
import image from './img.jpg';
import useRegisterAPI from "./API";
import { useEffect, useState } from "react";


const Details = (props:any) => {
    const mystate=useSelector((state:any)=>state.Fetch);
    const [profile,setProfile]=useState<Object>({})
    
    const List=useRegisterAPI();
    useEffect(()=>{
        List.map((users:any)=>{
            if(users.id===JSON.parse(Object(window.localStorage.getItem("Info"))).id){
                setProfile(users)
               
            }
        })
    },[])

    const editProfile=()=>{

    }
    console.log("List profile",Object(profile).id)
  return <>
         <div className="Detailsdiv">
                <div className="Deatilsimage">
                    <div>
                    <span title="Update"><RiUpload2Line/></span>
                    <img src={image} alt="User" width="170" height="170"/>
                    </div>
                    <div className="Ratingheading">
                    <h5>YOUR RATING</h5>
                    
                    <h5>ACTIVITY</h5>
                    
                    </div>
                <div className="Ratingvalue">
                    <h5> 54%</h5>
                    <h5>93%</h5>
                </div>
                </div>
                <div >
                    <div className="Detailsname">
                        <h3>{Object(profile).Name}</h3>
                        <button onClick={editProfile}><span><RiEdit2Fill /></span>EDIT</button>
                        <h5>{Object(profile).City}, {Object(profile).State}</h5>
                    </div>
                    <div className="Details">
                        <div style={{marginTop:"13px"}}>
                        <h4>Email</h4>
                        <h5 style={{marginLeft:"35px"}}>{Object(profile).email}</h5>
                        </div>
                        
                        <div >    
                        <h4>City</h4>
                        <h5 style={{marginLeft:"45px"}}>{Object(profile).City}</h5>
                        </div>
                        <div>
                        <h4>State</h4>
                        <h5 style={{marginLeft:"38px"}}>{Object(profile).State}</h5>
                        </div>
                        <div>
                        <h4>Country</h4>
                        <h5 style={{marginLeft:"14px"}}>{Object(profile).Country}</h5>
                        </div>
                        <div>
                        <h4>Phone</h4>
                        <h5 style={{marginLeft:"28px"}}>{Object(profile).Phone}</h5>
                        </div>
                        
                    </div>
                </div>     
        </div>   
  </>;
};
export default Details;
